description:
Kevin, a young flying fish, lives in the New York harbor. He dreams of leading his family back to Barbados-the mythical kingdom of the flying fish. One fateful day his adventurous nature finds him captured by a fishing ship and delivered to the fish tank of a famous restaurant in New York citys Chinatown, where he meets a quiet young boy who also longs for excitement and adventure. The two become fast friends and begin a daring quest to get Kevin back home to the sea.

